			shellPath = /bin/sh;
			shellScript = "dir=${PROJECT_DIR}/${PROJECT_NAME}/Base/Configuration\necho \"Starting environment configuration for project: \" $dir\n\n# environment variable from value passed in to xcodebuild.\n# if not specified, we default to DEV\nenv=${RN_ENVIRONMENT}\nif [ -z \"$env\" ]\nthen\nenv=\"DEV\"\nfi\necho \"Using $env environment\"\n\n# copy the environment-specific file\ncp $dir/environment_$env.plist $dir/environment.plist\n\n# Date and time that we are running this build\nbuildDate=`date \"+%F %H:%M:%S\"`\ntodaysDay=`date \"+%d\"`\n\n# app settings\nappName=`/usr/libexec/PlistBuddy -c \"Print :appName\" \"$dir/environment.plist\"`\n#adbAnalyticsServer=`/usr/libexec/PlistBuddy -c \"Print :adbAnalyticsServer\" \"$dir/environment.plist\"`\n#version=`/usr/libexec/PlistBuddy -c \"Print :CFBundleShortVersionString\" \"${PROJECT_DIR}/${PROJECT_NAME}/Application/${PROJECT_NAME}-Info.plist\"`\n#wbScheme=`/usr/libexec/PlistBuddy -c \"Print :wbScheme\" \"$dir/environment.plist\"`\n#qqScheme=`/usr/libexec/PlistBuddy -c \"Print :qqScheme\" \"$dir/environment.plist\"`\n#wxScheme=`/usr/libexec/PlistBuddy -c \"Print :wxScheme\" \"$dir/environment.plist\"`\n\nif [ \"$env\" != \"PROD\" ]  && [ \"$env\" != \"HOUSE\" ]\n\nthen\n# need to dynamically append today's day for non-prod\nappName=\"$appName $todaysDay\"\nfi\n\n# Last revision from the current branch\ncd ${PROJECT_DIR}/${PROJECT_NAME}/\n#revision=`/usr/bin/svnversion -nc | /usr/bin/sed -e 's/^[^:]*://;s/[A-Za-z]//'`\nrevision=`git rev-list HEAD | wc -l | awk '{print $1}'`\nversion=\"$version.$revision\"\n\n# Build the preprocess file\ncd ${PROJECT_DIR}/${PROJECT_NAME}/Base\npreprocessFile=\"environment_preprocess.h\"\necho \"Creating header file\"\n\necho \"//-----------------------------------------\" > $preprocessFile\necho \"// Auto generated file\" >> $preprocessFile\necho \"// Created $buildDate\" >> $preprocessFile\necho \"//-----------------------------------------\" >> $preprocessFile\necho \"\" >> $preprocessFile\necho \"#define RN_ENVIRONMENT              $env\" >> $preprocessFile\necho \"#define RN_ENVIRONMENT_APP_NAME     $appName\" >> $preprocessFile\necho \"#define RN_ENVIRONMENT_LAST_COMMIT  $version\" >> $preprocessFile\n\n# dump out file to build log\ncat $preprocessFile\n\n\n# Build the adobe mobile config file\n#cd ${PROJECT_DIR}/${PROJECT_NAME}/Vendors/AdobeMobileLibrary\n#adbMobileConfigFile=\"ADBMobileConfig.json\"\n#echo \"Creating adobe config file\"\n#sed \"s/{{[ ]*adbAnalyticsServer[ ]*}}/${adbAnalyticsServer}/g\" ${dir}/ADBMobileConfig.json.tpl > $adbMobileConfigFile\n\n# dump out config file\n#cat $adbMobileConfigFile\n\n\n# Force the system to process the plist file\necho \"Touching plist at: \" ${PROJECT_DIR}/${PROJECT_NAME}/Base/${PROJECT_NAME}-Info.plist\ntouch ${PROJECT_DIR}/${PROJECT_NAME}/Base/${PROJECT_NAME}-Info.plist\n\n# done\necho \"Done.\"\n\n\n\n";
